<?php

# @autogenerated
declare(strict_types=1);

namespace Civi\Lughauth\Features\Access\Master\RelyingParty\Domain\Event;

use Override;
use Civi\Lughauth\Features\Access\Master\RelyingParty\Domain\RelyingParty;

class RelyingPartyDisableEvent extends RelyingPartyUpdateEvent
{
    public function __construct(
        RelyingParty $payload,
        RelyingParty $original
    ) {
        parent::__construct($payload, $original);
    }
    #[Override]
    public function eventType(): string
    {
        return 'relying-party.disable';
    }
    #[Override]
    public function schemaVersion(): string
    {
        return 'v1';
    }
    #[Override]
    public function payload(): array
    {
        return $this->payload->asPublicJson();
    }
    #[Override]
    public function original(): array
    {
        return $this->original->asPublicJson();
    }
}
